import React from 'react'
import styled from 'styled-components'

const Ul = styled.ul`
    list-style: none;
    display: flex; 
    flew-flow: row nowrap;

li {
    padding: 5px;

    @media (max-width: 768px){
        flex-flow: colunm nowrap;
    }

}`

const RightNav = () => {
    return (
        <div>
              <Ul>
             <li>Home</li>
             <li>Skills</li>
             <li>Background</li>
             <li>Contact</li>
             </Ul>
        </div>
    )
}

export default RightNav
